import React, {useState} from 'react';
import { Layout } from 'antd';
import { Data } from "../data";
import { Row, Col } from 'antd';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Navsider from './Navsider'
import Survey from './Survey'
const { Content, Sider } = Layout;
const classObjects = Data.map((meet)=>{ return (meet.company) })
const Page = () => {
  const [view, setView] = useState(0);
  const [viewSelect] = useState(['0']);
  const pathRoute =['/Home']

    return (
      <Router>
        <Sider>
            <Navsider setView={setView} viewselect={viewSelect}/>
        </Sider>
            <Content>
            <Row className='content'>
              <Switch>
                <Route path={pathRoute[view]}>
                  <Col span={24} className={classObjects[view]}>
                    <Survey />
                    {console.log(classObjects[view])}
                  </Col>
                </Route>
              </Switch>
            </Row>
            </Content>
      </Router>
    );
}

export default Page;
